import React from 'react'
import "./Footer.css";


function Footer() {
  return (
    <div className='footer-container'>
        <svg width="1440" height="351" viewBox="0 0 1440 351" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path d="M1358 266H85V109.947C445.239 193.714 736.73 160.206 1063.67 122.622C1158 111.779 1255.27 100.597 1358 91.7934V266Z" stroke="#16213E" stroke-width="170"/>
        </svg>
    </div>
  )
}

export default Footer
